import React from 'react';
import logos from "./Logos.png";
import axios from 'axios';



//Função que solicita a url de login e abre a URL.
function login () {


    axios
    .get('/login')
    .then(url_login => {
      console.log(url_login.data);

      // window.location.href = url_login.data //Abre no brwoser a URL de login recebida.
    })


  }




  class Home extends React.Component {


    render (){
    return (

        <div >

          <header className="App-header">

            <img src={logos} className="logos" alt="Logo do DCC-UFMG e MPMG"></img>
            <h4> Protótipo de Confiança Zero com WS02 para o GSI</h4>
            <div className="circulo">
            </div>
              <button
              className = "button-login"
              onClick = {login}
              >
                Login
             </button>
          </header>

        </div>
      );
    }


  };

export default Home;
